$_MODULE['<{ets_cfultimate}prestashop>help_e78f8e3951507d3ad70bad04d263a0f6'] = 'Quando crei un nuovo modulo di contatto, se fai clic su [1]\"Aggiungi nuovo campo di input / riga per creare il tuo modulo di contatto\"[/1] link e seleziona un campo di input, per impostazione predefinita, questo campo di immissione verrà inserito su una riga a larghezza intera (1 colonna)';
$_MODULE['<{ets_cfultimate}prestashop>help_44bc6f8a71dc89fff236e12f6f869244'] = 'Per aggiungere il campo di input reCAPTCHA, è necessario prima abilitare reCAPTCHA. Vai a [1]\"Impostazioni > Integrazione > reCAPTCHA\"[/1], attiva l\'opzione reCAPTCHA e inserisci la tua coppia di chiavi.';
$_MODULE['<{ets_cfultimate}prestashop>help_fde06cf9e07c495e4089187d22fe1f8b'] = 'Per informazioni su come ottenere la chiave del sito e la chiave segreta di reCAPTCHA, consultare la documentazione del modulo';
$_MODULE['<{ets_cfultimate}prestashop>help_f9654c9df3f610569dd727b769581e6f'] = 'Per poter rispondere ai messaggi dei clienti direttamente sul back office, è necessario l\'indirizzo email del cliente. Quando crei un modulo di contatto, assicurati di aggiungere un campo di input email e contrassegnarlo come campo obbligatorio.';
$_MODULE['<{ets_cfultimate}prestashop>help_df8334930ebd39a1c1bd49057ddb3586'] = 'Configurazioni e-mail';
$_MODULE['<{ets_cfultimate}prestashop>help_439cf3a9e0342a20b68fcded2619e240'] = 'Per ottenere le informazioni dal modulo di contatto all\'e-mail che invia all di amministrazione o di risposta automatica, copia e incolla i rispettivi tag di posta in campo [1]\"Corpo del messaggio\"[/1] in [1]\"Moduli di contatto > Mail\"[/1] sottotabella';
$_MODULE['<{ets_cfultimate}prestashop>help_853b64314f465e7a1ebc1c63287ac7f1'] = 'Per ricevere il file allegato dal tuo cliente via email, vai a [1]\"Moduli di contatto > Mail\"[/1] e controlla la casella [1]\"File allegato\"[/1].';
